import React from "react";
import Header from '../components/Header';
import ContactForm from '../components/ContactForm';
import Footer from '../components/Footer';


function Contact() {
  return (
    <div>
      <Header />
      <h1>Contact</h1>
      <ContactForm />
      <Footer />
      <br />
    </div>
  );
}

export default Contact;
